    const { me } = useSelector((state) => state.user);

    return (
        <AppLayout>
            <div style={{ marginLeft: '200px' }}>
                <div style={{ position: 'relative', height: '400px', background: 'gray', opacity: '.2' }}></div>
                <div>
                    <div style={{ width: '150px', height: '150px', borderRadius: '50%', background: 'red', position: 'absolute', top: 0 }}>닉네임</div>
                    <div>follw 수</div>
                    <div>리뷰 수</div>
                    <div>follow 버튼</div>
                </div>
            </div>
        </AppLayout>
    )
}

export default myPage
